import React from "react";
import "./App.css";


const Navigation = ({onRouteChange,isSignedIn}) => {
    if (isSignedIn) {
        return (
            <ul >
                <li onClick={() => onRouteChange('home')}>ball shop</li>
                <li onClick={()=> onRouteChange('gotocart')}>your shopping cart</li>
                <li onClick={() => onRouteChange('sports')}>sports</li>
                <li onClick={() => onRouteChange('aboutme')}>about me</li>
                <li onClick={() => onRouteChange('signout')} className="push">sign out</li>
            </ul>
        );

    }
    else{
        return (
            <ul className="flex f3 link dim black underline pa3 pointer list-">
                <li onClick={() => onRouteChange('home')}>ball shop</li>
                <li onClick={()=> onRouteChange('gotocart')}>your shopping cart</li>
                <li onClick={() => onRouteChange('sports')}>sports</li>
                <li onClick={() => onRouteChange('aboutme')}>about me</li>
                <li onClick={() => onRouteChange('signin')} className="push">sign in</li>
                <li onClick={() => onRouteChange('register')}>register</li>
            </ul>

        );

        }
}
export default Navigation;
